import React from "react";
import Typewriter from "typewriter-effect"
import "../Header/Header.css"

const Header = () => {
    return (
        <>
            <div className="Header-text">
                <Typewriter
                options={{
                    autoStart:true,
                    loop:true,
                    delay:40,
                    strings: [
                      <strong>Hai Bestie</strong>,  
                        "Selamat datang di Allforyougive",
                        "silahkan berbelanja bestie"
                    ]
                }}
                >

                </Typewriter>
            </div>
        </>
    )
}



export default Header;
